import React from "react";
import Avatar from "./Avatar";
import Alert from './Components/Alert';

const User = ({ name, avatar, status, email }) => {

  return (
    <div className="row">
      <div className="col-sm-2 profile">
        <Avatar avatar={avatar} width={100} shape="squar" name={name} />
        <p>{name}</p>
        <p>{status}</p>
        <p>{email}</p>
      </div>
    </div>
  );
};

export default User;
